/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable jsx-a11y/label-has-associated-control */
import React from 'react';
import faker from 'faker';
import PropTypes from 'prop-types';
import devHelpers from 'utils/devHelpers';

const ApplicantsDataList = ({ setApplicantInfo }) => {
  const applicantsData = [...Array(10).keys()].map(() => ({
    userId: faker.datatype.number(),
    name: faker.name.findName(),
    handle: faker.name.findName(),
    priorityQueue: faker.datatype.number(),
    score: faker.datatype.number(),
    applicationDate: faker.date.past().toDateString(),
  }));

  const applicantDataOnClickHandler = (applicantUserId) => {
    console.log(`the applicantid is: ${applicantUserId}`);
    setApplicantInfo(devHelpers.getFakeApplicantData({ userId: applicantUserId }));
  };

  return (
    <div className="applicants-data-list box">
      <Filters />
      <table className="table is-striped is-bordered is-hoverable is-fullwidth">
        <thead>
          <tr>
            <th>Name</th>
            <th>Handle</th>
            <th><abbr title="Prior. Q.">Priority Queue</abbr></th>
            <th>Score</th>
            <th><abbr title="App. Date">Application Date</abbr></th>
          </tr>
          <tr>
            <th>
              <div className="field">
                <input className="input" type="text" placeholder="Filter" />
              </div>
            </th>
            <th>
              {' '}
              <div className="field">
                <input className="input" type="text" placeholder="Filter" />
              </div>
            </th>
            <th>
              <abbr title="Prior. Q.">
                {' '}
                <div className="field">
                  <input className="input" type="text" placeholder="Filter" />
                </div>
              </abbr>
            </th>
            <th>
              {' '}
              <div className="field">
                <input className="input" type="text" placeholder="Filter" />
              </div>
            </th>
            <th>
              <abbr title="App. Date">
                {' '}
                <div className="field">
                  <input className="input" type="text" placeholder="Filter" />
                </div>
              </abbr>
            </th>
          </tr>
        </thead>
        <tbody>
          {
            applicantsData.map((applicantData) => (
              <tr onClick={() => applicantDataOnClickHandler(applicantData.userId)}>
                <td>{applicantData.name}</td>
                <td>{applicantData.handle}</td>
                <td>{applicantData.priorityQueue}</td>
                <td>{applicantData.score}</td>
                <td>{applicantData.applicationDate}</td>
              </tr>
            ))
          }
        </tbody>
      </table>
      <Pagination />
    </div>
  );
};
ApplicantsDataList.propTypes = {
  setApplicantInfo: PropTypes.func.isRequired,
};

const Filters = () => {
  console.log('filters');
  return (
    <div className="filters-section">
      <label className="label" htmlFor="applicants-search">Global Filters</label>
      <div className="box filters">
        <div className="select is-fullwidth">
          <select>
            <option>Select dropdown</option>
            <option>With options</option>
          </select>
        </div>
        <input className="input is-fullwidth" id="applicants-search" type="text" placeholder="Search" />
      </div>
    </div>
  );
};

const Pagination = () => {
  return (<nav className="pagination" role="navigation" aria-label="pagination">
    <a className="pagination-previous">Previous</a>
    <a className="pagination-next">Next page</a>
    <ul className="pagination-list">
      <li>
        <a className="pagination-link" aria-label="Goto page 1">1</a>
      </li>
      <li>
        <span className="pagination-ellipsis">&hellip;</span>
      </li>
      <li>
        <a className="pagination-link" aria-label="Goto page 45">45</a>
      </li>
      <li>
        <a className="pagination-link is-current" aria-label="Page 46" aria-current="page">46</a>
      </li>
      <li>
        <a className="pagination-link" aria-label="Goto page 47">47</a>
      </li>
      <li>
        <span className="pagination-ellipsis">&hellip;</span>
      </li>
      <li>
        <a className="pagination-link" aria-label="Goto page 86">86</a>
      </li>
    </ul>
  </nav>);
};

export default ApplicantsDataList;
